import styles from "../../Css/Cart.module.css";
import CartHeader from "./CartHeader";
import CartList from "./CartList";
import TotalCart from "./totalCart";

function Cart() {
  return (
    <>
      <header className={styles.header}>
        <h1>장바구니</h1>
      </header>
     <CartHeader/>
     <CartList/>
     <TotalCart/>
      
    </>
  );
};

export default Cart;
